var tipuesearch = {"pages": [{'title': 'W1-W5', 'text': 'w1 建立個人倉儲cd2020 \n 複習如何使用git指令 \n 老師講解每周的進度 \n w2 重新建一個隨身系統及小組直播分工 \n 到 https://www.python.org/downloads/windows 下載 Windows x86-64 executable installer 接下來我就參考同學的方法去做 \n W2小組直播 \n 分工內容: \n 40523253:亂數分組程式 40623117:亂數分組程式 40623252:4輪車 40723221 (group leader) :4輪車 40723222:4輪車 40723228:亂數分組程式 40723236:4輪車 40723237:可攜系統 40723240:4輪車 40723243:4輪車 40723244:可攜系統 40723249:可攜系統 40732331:4輪車\xa0 \n 我抽到的是亂數分組 \n w3 製作亂數分組功能 \n 達到亂數分組的功能後，將結果做成PDF檔放在downloadsads底下 \n https://github.com/40623117/cd2020/tree/master/downloads \n w4 \n 完成assignment1並且完成自互評 \n w5 清明連假 \n', 'tags': '', 'url': 'W1-W5.html'}, {'title': 'W6-9', 'text': '\n https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'W6-9.html'}]};